import React from 'react';
import './IntroSection.css';

function IntroSection() {
  return (
    <section className="intro-section">
      <h2>О нашей компании</h2>
      <p>
        Мы — производители элитной мебели, создающие уникальные интерьерные решения для ваших домов и офисов. 
        Каждый проект для нас — это возможность доказать, что мебель может быть не просто функциональной, 
        но и искусством.
      </p>
      <img src="Users/padkas2001gmail.com/Desktop/kurs_web/src/Image/img1.jpg" alt="Пример работы 1" />
        <img src="Users/padkas2001gmail.com/Desktop/kurs_web/src/Image/img2.jpg" alt="Пример работы 2" />
        <img src="Users/padkas2001gmail.com/Desktop/kurs_web/src/Image/img3.jpg" alt="Пример работы 3" />
      <p>
        С 2023 года мы помогаем нашим клиентам преобразить их пространства, создавая мебель, 
        которая отражает их индивидуальность и стиль.
      </p>
    </section>
  );
}

export default IntroSection;
